import Sidebar from './components/sidebar'
import Route from "./components/Route";
import AccordionPage from './pages/AccordionPage';
import DropDownPage from './pages/DropDownPage';

function App() {
    return <div>
        <Sidebar />
        <div>
            <Route path='/accordion'>
                <AccordionPage />
            </Route>
            <Route path='/'>
                <DropDownPage />
            </Route>
            <Route path='/buttons'>
                <ButtonPa />
            </Route>
        </div>
    </div>;
}

export default App;
